import React from "react";
import {useEffect,useState} from "react";

function Teammates() {

    const url = 'http://localhost:9000/api/companeros';
  const [todos, setTodos] = useState()
  const fetchApi = async() => {
    const response = await fetch(url)
    const responseJSON = await response.json()
    setTodos(responseJSON)
  }
  useEffect(() =>{
    fetchApi()
  },[])
    return (

        <div className="Container">
            <figure class="text-center">
                <blockquote class="blockquote">
                    <p>Compa√±eros registrados</p>
                </blockquote>
            </figure>

            <div>
           
              {!todos ? 'Cargando..': todos.map((todo, index) => {
              return (
                <div class="card" style={{ width: "18rem" }}>
                <img src="https://www.tonica.la/__export/1619729098451/sites/debate/img/2021/04/29/bucky-barnes-sexualidad-the-falcon-and-the-winter-soldier-sebastian-stan_1.jpg_463833556.jpg" class="card-img-top" alt="asdas"></img>
                <div class="card-body">
                    <h5 class="card-tittle">{todo.name}</h5>

                    <ul class="list-group list-group-flush">
                        <li class="list-group-item">Super Poder: {todo.superpower}</li>
                        <li class="list-group-item">Aliado desde: {todo.mateSince}</li>
                        <li class="list-group-item">Telefono: +1 {todo.phone}</li>
                    </ul>

                </div>


            </div>
              );
            })}
                
          
          
            
            </div>


        </div>

    );
}

export default Teammates;
